package com.company;


import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class isAnagram {

    public static void main(String[] args) {
        String str1 = "";
        String str2 = "";

        isAnagram t = new isAnagram();

        System.out.println(t.fun(str1,str2));
        System.out.println(t.fun2(str1,str2));
        System.out.println(t.fun3(str1,str2));

    }
    //创建数组存储,数组下标为char-'a', 值为数量, 如果符合, 每个位置都应为0值
    public Boolean fun3(String str1,String str2){
        if(str1.length()==0 || str1.isEmpty()){
            return false;
        }
        if(str1.length() != str2.length()){
            return false;
        }

        int[] counter = new int[26];
        for (int i = 0; i < str1.length(); i++) {
            counter[str1.charAt(i)-'a']++;
            counter[str2.charAt(i)-'a']--;
        }
        for(int c:counter){
            if(c!=0){
                return false;
            }
        }
        return true;
    }

    //创建数组存储,数组下标为char-'a', 值为数量, 如果符合, 每个位置都应为0值 --fun3的优化版, 提前拦截
    public Boolean fun4(String str1,String str2){
        if(str1.length()==0 || str1.isEmpty()){
            return false;
        }
        if(str1.length() != str2.length()){
            return false;
        }

        int[] counter = new int[26];
        for (int i = 0; i < str1.length(); i++) {
            counter[str1.charAt(i)-'a']++;
        }
        for (int j = 0; j < str2.length(); j++) {
            counter[str2.charAt(j)-'a']--;
            if(counter[str2.charAt(j)-'a']<0){
                return false;
            }
        }

        return true;
    }


    //排序比较
    public Boolean fun(String str1,String str2){
        if(str1.length() != str2.length()){
            return false;
        }
        char[] arrayStr1 = str1.toCharArray();
        char[] arrayStr2 = str2.toCharArray();
        Arrays.sort(arrayStr1);
        Arrays.sort(arrayStr2);
        /*for (int i = 0; i < arrayStr1.length; i++) {
            if(arrayStr1[i] != arrayStr2[i]){
                return false;
            }
        }*/
        return Arrays.equals(arrayStr1,arrayStr2);
    }

    //map计数
    public Boolean fun2(String s,String t){
        if(s.length() != t.length()){
            return false;
        }
        Map<Character,Integer> map1 = new HashMap<Character,Integer>();
        Map<Character,Integer> map2 = new HashMap<Character,Integer>();

        for (int i = 0; i < s.length(); i++) {
            //对各个字母计数
            char temp = s.charAt(i);
            if(map1.containsKey(temp)){
                map1.put(temp,map1.get(temp)+1);
            }else{
                map1.put(temp,1);
            }
            //处理第二个
            temp = t.charAt(i);
            if(map2.containsKey(temp)){
                map2.put(temp,map2.get(temp)+1);
            }else{
                map2.put(temp,1);
            }
        }
        if(map2.size() != map1.size()){
            return false;
        }
        for(Map.Entry<Character,Integer> item : map1.entrySet()) {
            if(!map2.containsKey(item.getKey()) ){
                return false;
            }
            if(map2.get(item.getKey())!=item.getValue()) {
                System.out.println(item.getKey());
                System.out.println(item.getValue());
                System.out.println(map2.get(item.getKey()));
                return false;
            }
        }
        return true;
    }

}
